import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";

function Dashboard() {
  const navigate = useNavigate();
  const [transactions, setTransactions] = useState([]);
  const [loading, setLoading] = useState(true);
  const [totalSpent, setTotalSpent] = useState(0);

  useEffect(() => {
    const fetchTransactions = async () => {
      try {
        const token = localStorage.getItem("token"); // Assuming token is stored in localStorage
        const response = await fetch(
          "http://localhost:3001/api/user-transactions",
          {
            method: "GET", // Correct placement of the method
            headers: { Authorization: token },
          }
        );

        if (!response.ok) {
          throw new Error("Failed to fetch transactions");
        }

        const data = await response.json();
        setTransactions(data.transactions);

        const total = data.transactions.reduce(
          (sum, transaction) => sum + transaction.amount,
          0
        );
        setTotalSpent(total);

        setLoading(false);
      } catch (err) {
        console.error("Error fetching user transactions:", err);
        setLoading(false);
      }
    };

    fetchTransactions();
  }, []);

  const handleLogout = () => {
    localStorage.removeItem("token");
    navigate("/");
  };

  const goToPaymentPage = () => {
    navigate("/pay");
  };

  const goToPayoutPage = () => {
    navigate("/payout");
  };

  return (
    <div className="container">
      <header className="dashboard-header">
        <h1 className="dashboard-title">User Dashboard</h1>
        <div className="dashboard-actions">
          <button className="button primary-button" onClick={handleLogout}>
            Logout
          </button>
          <button className="button primary-button" onClick={goToPaymentPage}>
            Go to Pay
          </button>
          <button className="button primary-button" onClick={goToPayoutPage}>
            Go to Payout
          </button>
        </div>
      </header>
      <section className="transactions-section">
        <h2>Your Transactions</h2>
        {loading ? (
          <p>Loading your transactions...</p>
        ) : transactions.length > 0 ? (
          <>
            <p className="total-spent">
              <strong>Total Amount Spent:</strong> {totalSpent.toFixed(2)}{" "}
              {transactions[0]?.currency}
            </p>

            <table className="transactions-table">
              <thead>
                <tr>
                  <th>Date</th>
                  <th>Amount</th>
                  <th>Status/Receipt</th>
                </tr>
              </thead>
              <tbody>
                {transactions.map((transaction) => (
                  <tr key={transaction._id}>
                    <td>{new Date(transaction.createdAt).toLocaleString()}</td>
                    <td>
                      {transaction.amount} {transaction.currency}
                    </td>

                    <td>
                      <a
                        href={transaction.receiptUrl}
                        target="_blank"
                        rel="noopener noreferrer"
                        style={{ color: "blue", textDecoration: "underline" }}
                      >
                        {transaction.status}
                      </a>
                    </td>
                  </tr>
                ))}
              </tbody>
            </table>
          </>
        ) : (
          <p>No transactions found.</p>
        )}
      </section>
    </div>
  );
}

export default Dashboard;
